            `POSITION` int NOT NULL,
            `SUBLINK_URL` varchar(255) CHARACTER
        SET
            utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
            `VERSION_LOCK` int NOT NULL DEFAULT '0',
            `LINK_ID` bigint NOT NULL,
            PRIMARY KEY (`ID`),
            UNIQUE KEY `UIDX_SUBLINK_LINK` (`LINK_ID`, `POSITION`),
            CONSTRAINT `FK_SUBLINK_LINK` FOREIGN KEY (`LINK_ID`) REFERENCES `snc_launcher_link` (`ID`)
